import "./Header.scss";
import { Link, NavLink } from 'react-router-dom';

function Header() {
    return (
        <>
            <div className="header">
                <nav className="nav">
                    <Link to="/" className="nav__logo-link" >
                        <p>logo</p>
                    </ Link>

                    <div className="nav__page">

                        <NavLink to="/" className="nav__title">
                            Gallery
                        </NavLink>

                        <NavLink to="/" className="nav__title">
                            My Gallery
                        </NavLink>

                    </div>
                </nav>
            </div>

        </>
    );
}

export default Header;
